import React from "react";
// import Button from 'react-bootstrap/Button';
import { useEffect } from "react";
import Card from 'react-bootstrap/Card';
//this component is for each individual location
function LocationCard({location, onDeleteLocation}) {
    //destructuring the location object
    const {city, state, id} = location;

    useEffect(() => {
        fetch("http://localhost:9292/")
          .then((r) => r.json())
          .then((data) => console.log(data)); 
      }, []); 

    return (
        <ul className="card">
            <Card style={{ width: '50rem' }}>
                {/* <Card.Img variant="top" src={image_url} /> */}
                <Card.Body>
                    <Card.Title><h2>{city}</h2></Card.Title>
                    <Card.Subtitle><b>{state}</b></Card.Subtitle>
                    {/* <Card.Text>
                    {state}
                    </Card.Text> */}
                    {/* <Button variant="primary" onClick={handleDelete}>Delete</Button> */}
                </Card.Body>
            </Card>
            <br/>
            <p></p>
        </ul>
    )
}

export default LocationCard;
